import React from 'react';
import video from '../assets/Images/Mohan-muruge.jpg';

export default function NextVideo() {
    return (
        <div className="next-video">
            <h5 className="next-video__heading">NEXT VIDEO</h5>
            <div>
                <div className="next-video__left">
                    <img className="next-video__video" src={video} alt="" />
                </div>
                <div className="next-video__right">
                    <span>
                        Become A Travel Pro In One Easy Lessonâ€¦
                </span>
                    <span>
                        Scotty Cranmer
                </span>
                </div>

            </div>
        </div>
    );
}
